import React, {useState} from 'react';
import {Link} from "react-router-dom";
import {toast, ToastContainer} from "react-toastify";

const ForgotPage = () => {
    const [email, setEmail] = useState('');
    const [phone_number, setPhoneNumber] = useState('');

    function findUsername(e) {
        e.preventDefault();

        // Check if any required field is empty
        if (email === '' || phone_number === '') {
            toast.warn('Please fill out fields', {
                position: "top-center",
                draggable: true,
                hideProgressBar: true
            });
            return;
        }

        // Check if phone_number follows the specified format
        if (!/^\d{3}-\d{3}-\d{4}$/.test(phone_number)) {
            toast.warn('Phone number should be in format 123-456-7890', {
                position: "top-center",
                draggable: true,
                hideProgressBar: true
            });
            return;
        }

        const findUser = {email, phone_number};
        console.log(findUser);

        fetch("localhost:8080/chatbot/user/{email}")


    }

    return (
        <div className="register">
            <form className="register-form">
                <div className="register-container">
                    <h1 className="register-title">Signup</h1>
                    <div className="info-container">
                        <label>
                            <p className="m-1 text-uppercase fs-5 fw-semibold text-body-secondary">User Name:</p>
                            <input className="username fs-5" type="text" name="uname" placeholder="User name" required={true} autoFocus={true}
                                   value={username} onChange={(e) => setUsername(e.target.value)}/>
                        </label>
                        <label>
                            <p className="m-1 text-uppercase fs-5 fw-semibold text-body-secondary">Password:</p>
                            <input className="password" type="password" name="password" placeholder="Password" required={true}
                                   value={password} onChange={(e) => setPassword(e.target.value)}/>
                        </label>
                        <label>
                            <p className="m-1 text-uppercase fs-5 fw-semibold text-body-secondary">Email Address:</p>
                            <input className="email" type="email" name="email" placeholder="Email" required={true}
                                   value={email} onChange={(e) => setEmail(e.target.value)}/>
                        </label>
                        <label>
                            <p className="m-1 text-uppercase fs-5 fw-semibold text-body-secondary">Phone Number:</p>
                            <input className="phone" type="tel" name="phone" placeholder="123-456-7890" pattern="[0-9]{3}-[0-9]{3}-[0-9]{4}" required={true}
                                   value={phone_number} onChange={(e) => setPhoneNumber(e.target.value)}/>
                        </label>
                    </div>
                    <input className="m-4 btn btn-primary fs-5 text-uppercase" id="registerButton" type="submit" value="Join Us" onClick={handleSignUp}/>
                    <div className="register-footer">
                        <span className="m-3 fs-5">Already have an account?</span><Link to="/main" className="fs-5">Login</Link>
                    </div>
                </div>
            </form>
            <ToastContainer />
        </div>
    );
};

export default ForgotPage;
